import React, { useEffect, useState } from "react";
import ImPagination from "./ImPagination";
const ImImagesRes = () => {
  const [imagedeta, setImagedeta] = useState([""]);
  const [page,setPage] = useState(1)

  const FetchImagesData = () => {
    fetch(
      `https://pixabay.com/api/?key=38320105-b762e964374d782b30b2f8654&q=food&image_type=photo&orientation="all"&safesearch="false"&order="popular"&colors=""&per_page=200&page=${page}`
    )
      .then((res) => res.json())
      .then((ImageData) => {
        console.log(ImageData);
        setImagedeta(ImageData.hits);
      });
  };

  useEffect(() => {
    FetchImagesData();
  }, []);

  return (
    <>
      <div className="Im-Images-Container">
        <div className="Im-Images-Container-box">
          {imagedeta.map((elements) => {
            return (
              <>
                <div className="img-res" onClick={() => alert(elements.id)}>
                  <img
                    className="on-img"
                    src={elements.webformatURL}
                    alt="img.jpg"
                  />
                </div>
              </>
            );
          })}
        </div>
      </div>
      <ImPagination/>
    </>
  );
};

export default ImImagesRes;
